import {Component} from  'react';
import ClientSetup from './components/ClientSetupScreen';
import AllocationScreen from './components/TestCodeAllocationScreen';
import LoginScreen from './components/LoginScreen';
    import ContactForm from './components/ContactForm';
import ClientDetails from './components/ClientDetails';
import { Router, Switch, Route } from "react-router-dom";

export default class Routes extends Component {
    render() {
        return(
            <Router history={history}>
                <Switch>
                    <Route path="/" exact component={LoginScreen} />
                    <Route path="/ClientDetails"  component = {ClientDetails} />
                    <Route path="/ClientSetup" exact component = {ClientSetup} />
                </Switch>
            </Router>
        )
    }
}
